 CREATE TABLE Company_Landlord (    Companyid int NOT NULL,    Companyname varchar(255) NOT NULL,    PRIMARY KEY (Companyid));CREATE TABLE Tenant (    Tenantid int NOT NULL,    Name varchar(255) NOT NULL,    Address varchar(255) NOT NULL,    Phone varchar(255) NOT NULL,    PRIMARY KEY (Tenantid));CREATE TABLE Apartment_House (    Apartmentid int NOT NULL,    Companyid int NOT NULL,    Squarefeet int NOT NULL,    Apartmentaddress varchar(255) NOT NULL,    Apartmentnum int NOT NULL,    PRIMARY KEY (Apartmentid),    FOREIGN KEY (Companyid) REFERENCES Company_Landlord(Companyid));CREATE TABLE Lease (    Leaseid int NOT NULL,    Apartmentid int NOT NULL,    Tenantid int NOT NULL,    Startdate date NOT NULL,    Enddate date NOT NULL,    PRIMARY KEY (Leaseid),    FOREIGN KEY (Apartmentid) REFERENCES Apartment_House(Apartmentid)    FOREIGN KEY (Tenantid) REFERENCES Tenant(Tenantid));INSERT INTO Company_Landlord VALUES (1,íChartwellsí),(2,íHousing incí),(3,íLive For Lessí),(4,íThe Shoresí);INSERT INTO Apartment_House VALUES (1,1,1380,í100 Lake Morton Dr, Lakeland, FL 33801í,543),(2,2,900,í4141 US Hwy 98 N, Lakeland, FL 33809í,234),(3,3,1200,í219 N Massachusetts Ave, Lakeland, FL 33801í, 567),(4,4,700,í1475 Walt Loop Rd, Lakeland, FL 33809í,174);INSERT INTO Lease VALUES (1,1,1,í2021-07-12í,í2022-06-12í),(2,2,2,í2021-07-21í,í2022-07-20í),(3,3,3,í2021-06-15í,í2022-06-14í),(4,4,4,í2021-05-14í,í2022-05-14í);INSERT INTO Tenant VALUES (1,íJohn Doeí,í2341 Buffalo Dr, Lakeland, FL 33800í,í435-124-4235í),(2,íSteven Jonesí,í2345 Raceway St, Riverview, FL 33568í,í234-534-2634í),(3,íRachel Kingí,í6543 Jacaranda St, Gibsonton, FL 33567í,í123-543-6434í),(4,íJimmy Swiftí,í9865 Summerfield Rd, Miami, FL 23142í,í987-212-4536í);                                                                                                                                                                                                                                    